import { Center, Link, Box } from "@chakra-ui/react";

export default function Navbar() {
	return (
		<Box p="5" bg="blue.600" color="white">
			<Link href="/">Home</Link>
			<Link ml="10" href="/">
				Contact
			</Link>
			<Link ml="10" href="/">
				About
			</Link>
		</Box>
	);
}
